script: |
  super -f text -I q2334.spq | sort > q2334.out

inputs:
  - name: q2334.spq
    data: |
      SELECT DISTINCT col2 * + + 30 - col0 + ( + - 7 ) * 36 + + + col2, + col1 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE 21 / - col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q2334.out
    data: |
      1471	67
      415	51
      924	77
